import React, {Fragment} from 'react';
import {Typography} from '@material-ui/core';
import styled from 'styled-components';

const Box = styled.div`
  margin: 5px;
  border: 5px black;
  background-color: #a1887f;
  color: #efebe9;
  width:63px;
  height:63px;

`;
const Text = styled.div`

  font-size: 20px;

`

function Die({key, roll}){

    console.log(`printing die ${roll}`)

    return <Box key={key}> <Text>{roll}</Text></Box>
}

export default Die
